import React from 'react';
import { motion } from 'framer-motion';

const LoadingScreen = () => {
  return (
    <div className="h-screen w-screen bg-[#f3f3f3] flex justify-center items-center">
      <motion.div
        className="border-t-4 border-gray-900 border-solid rounded-full w-16 h-16 animate-spin"
        initial={{ rotate: 0 }}
        animate={{ rotate: 360 }}
        transition={{ duration: 1, ease: 'linear', loop: Infinity }}
      />
    </div>
  );
};

export default LoadingScreen;
